/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmDblClickFullscreen 
} from '@vime/core';

import { define } from '../lib';


define('vm-dbl-click-fullscreen', VmDblClickFullscreen);


export interface DblClickFullscreenProps extends JSX.VmDblClickFullscreen, HTMLAttributes<HTMLVmDblClickFullscreenElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmDblClickFullscreenElement, DblClickFullscreenProps>(
  'vm-dbl-click-fullscreen',
  new Set(['useOnMobile','isFullscreenActive','isVideoView','playbackReady','isMobile']),
);
